import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import {
  Box,
  Button,
  Container,
  Grid,
  Typography,
  Card,
  CardMedia,
  CardContent,
  CardActions,
  TextField,
  Select,
  MenuItem,
  InputAdornment,
  Paper,
} from '@mui/material';
import { Search } from '@mui/icons-material';
import immunityBoosterImg from '../assets/images/immunity-booster.png';
import greenDetoxImg from '../assets/images/green-detox.png';

const categories = [
  'All Categories',
  'Healthy Break Fast',
  'Healthy Juices',
  'Herbal Teas',
  'Hot Beverages',
];

const featuredJuices = [
  {
    id: 1,
    name: 'Immunity Booster',
    description: 'Orange, Carrot, and Ginger blend',
    image: immunityBoosterImg,
    price: '$5.99',
  },
  {
    id: 2,
    name: 'Green Detox',
    description: 'Spinach, Apple, and Mint refresher',
    image: greenDetoxImg,
    price: '$6.99',
  },
  {
    id: 3,
    name: 'Berry Blast',
    description: 'Mixed berries with pomegranate',
    image: 'https://source.unsplash.com/400x300/?berry-juice',
    price: '$7.99',
  },
];

function Home() {
  const navigate = useNavigate();
  const [category, setCategory] = useState('All Categories');
  const [searchQuery, setSearchQuery] = useState('');

  const handleSearch = () => {
    // Here you would typically handle the search with the category and query
    navigate(`/menu?category=${encodeURIComponent(category)}&search=${encodeURIComponent(searchQuery)}`);
  };

  return (
    <Box>
      {/* Hero Section with Search */}
      <Box
        sx={{
          bgcolor: 'primary.main',
          color: 'white',
          py: 8,
          textAlign: 'center',
        }}
      >
        <Container>
          <Typography variant="h2" component="h1" gutterBottom>
            Fresh & Healthy Juices
          </Typography>
          <Typography variant="h5" component="h2" gutterBottom>
            Discover the taste of real fruits
          </Typography>
          
          {/* Search Bar */}
          <Paper
            component="form"
            sx={{
              p: 2,
              display: 'flex',
              alignItems: 'center',
              maxWidth: 800,
              margin: '2rem auto',
              gap: 2,
            }}
            elevation={3}
          >
            <Select
              value={category}
              onChange={(e) => setCategory(e.target.value)}
              sx={{ 
                minWidth: 200,
                bgcolor: 'white',
                '& .MuiSelect-select': {
                  py: 1,
                }
              }}
            >
              {categories.map((cat) => (
                <MenuItem key={cat} value={cat}>
                  {cat}
                </MenuItem>
              ))}
            </Select>
            
            <TextField
              fullWidth
              placeholder="Search products..."
              value={searchQuery}
              onChange={(e) => setSearchQuery(e.target.value)}
              sx={{ bgcolor: 'white', borderRadius: 1 }}
              InputProps={{
                endAdornment: (
                  <InputAdornment position="end">
                    <Search />
                  </InputAdornment>
                ),
              }}
            />
            
            <Button
              variant="contained"
              color="secondary"
              size="large"
              onClick={handleSearch}
              sx={{ 
                px: 4,
                py: 1,
                borderRadius: 2,
              }}
            >
              Search
            </Button>
          </Paper>
        </Container>
      </Box>

      {/* Featured Juices */}
      <Container sx={{ py: 8 }}>
        <Typography variant="h4" component="h2" gutterBottom textAlign="center">
          Featured Juices
        </Typography>
        <Grid container spacing={4} sx={{ mt: 2 }}>
          {featuredJuices.map((juice) => (
            <Grid item xs={12} sm={6} md={4} key={juice.id}>
              <Card sx={{ height: '100%', display: 'flex', flexDirection: 'column' }}>
                <CardMedia
                  component="img"
                  height="200"
                  image={juice.image}
                  alt={juice.name}
                />
                <CardContent sx={{ flexGrow: 1 }}>
                  <Typography gutterBottom variant="h5" component="h3">
                    {juice.name}
                  </Typography>
                  <Typography>{juice.description}</Typography>
                  <Typography variant="h6" color="primary" sx={{ mt: 2 }}>
                    {juice.price}
                  </Typography>
                </CardContent>
                <CardActions>
                  <Button size="small" color="primary">
                    Add to Cart
                  </Button>
                  <Button size="small" color="primary">
                    Learn More
                  </Button>
                </CardActions>
              </Card>
            </Grid>
          ))}
        </Grid>
      </Container>
    </Box>
  );
}

export default Home;
